export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},xBAN2AdW4w:{data:{id:1669,attributes:{imdbId:"tt0044760",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTFmZDZjMDEtNTFjNi00YWE1LTlhNWUtNDc2NzFmNmQ2YTNjXkEyXkFqcGdeQXVyNTEwNDcxNDc@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"82%"}],item_lang:{data:{id:2332,attributes:{title:d,plot:"In the center of this Walter Scott classic fiction inspired movie the chivalrousness and the daring stand. Sir Wilfred of Ivanhoe (Robert Taylor), the disowned knight join to the bravehearted and high-minded Robin of Locksley (Harold Warrender), the valiant of Sherwood Forest. They want King Richard (Norman Wooland) to rule the kingdom instead of evil Prince John (Guy Rolfe).",slug:"ivanhoe"}}},books:{data:[{id:8635,attributes:{title:d,description:"\"Fight on, brave knights! Man dies, but glory lives!\" Banished from England for seeking to marry against his father's wishes, Ivanhoe joins Richard the Lion Heart on a crusade in the Holy Land. On his return, his passionate desire is to be reunited with the beautiful but forbidden lady Rowena, but he soon finds himself playing a more dangerous game as he is drawn into a bitter power struggle between the noble King Richard and his evil and scheming brother John. The first of Scott's novels to address a purely English subject, Ivanhoe is set in a highly romanticized medieval world of tournaments and sieges, chivalry and adventure where dispossessed Saxons are pitted against their Norman overlords, and where the historical and fictional seamlessly merge. For more than seventy years, Penguin has been the leading publisher of classic literature in the English-speaking world. With more than 1,700 titles, Penguin Classics represents a global bookshelf of the best works throughout history and across genres and disciplines. Readers trust the series to provide authoritative texts enhanced by introductions and notes by distinguished scholars and contemporary authors, as well as up-to-date translations by award-winning translators.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=l2kwLXJGWbgC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[f],firstBook:true,published:"2000-10-01",publisher:"Penguin",subtitle:b}},{id:8636,attributes:{title:d,description:"Sir Wilfred of Ivanhoe is a Saxon knight whose allegiance to King Richard and love for Lady Rowena severely damages his relationship with his father. He is disinherited from his family and must find a respectable way to re-enter society. In twelfth-century England, tensions between the Saxons and Normans are at an all-time high. Following the Third Crusade, Sir Wilfred Ivanhoe, a Saxon knight, offers his support to the Norman King Richard, which pits him against his father, Cedric. Ivanhoe is also in love with the beautiful Lady Rowena, whom Cedric has promised to another. Due to his actions, the knight loses his family claim and is left to fend for himself. Ivanhoe chooses to conceal his identity, entering a tournament to regain his honor and the admiration of Lady Rowena. A classic tale informed by historical events, Ivanhoe is one of Sir Walter Scott's most enduring stories. It was famously adapted in 1952 as a feature film starring Robert Taylor, Elizabeth Taylor and Joan Fontaine. With an eye-catching new cover, and professionally typeset manuscript, this edition of Ivanhoe is both modern and readable.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FDEvzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[f],firstBook:e,published:"2021-02-01",publisher:"Mint Editions",subtitle:b}},{id:8637,attributes:{title:"The Works of Sir Walter Scott: Ivanhoe",description:b,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ExMOAQAAMAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[f],firstBook:e,published:"1913-01-01",publisher:b,subtitle:b}},{id:8638,attributes:{title:"Sir Walter Scott's Ivanhoe",description:"Relates the adventures of the Saxon knight Ivanhoe in 1194, the year of Richard the Lion-Hearted's return from the Third Crusade.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=74nwwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[h,"David Purdie"],firstBook:e,published:"2012-01-01",publisher:"Luath Press",subtitle:"Newly Adapted for the Modern Reader by David Purdie"}},{id:8639,attributes:{title:d,description:"\" Ivanhoe \" es la obra maestra de la novela histórica. Combinando la historia real de Inglaterra con el fruto de su imaginación, Walter Scott nos traslada a una época pasada, la de las Cruzadas medievales, y nos pone en contacto con los pueblos sajón y normando y con algunos de los personajes más representativos de su tradición legendaria, como Ricardo Corazón de León o Robin Hood. Con todo, este novelista escocés sabe mantener el interés de los lectores con gran maestría, por lo que esta obra ha traspasado la frontera del tiempo.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3fVQPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[h,"María Lourdes Íñiguez Barrena"],firstBook:e,published:"2009-02-23",publisher:"Anaya Infantil",subtitle:b}}]}}},meta:{}}},prerenderedAt:1688531350172}}("movie","","series","Ivanhoe",null,"Sir Walter Scott",1,"Walter Scott, Sir"))